import React, { useState } from 'react';
import { ComposableMap, Geographies, Geography, Annotation } from 'react-simple-maps';
import { geoCentroid } from 'd3-geo';

const geoUrl = "/custom.geo.json";

const countryNameMap = {
  Japan: "Êó•Êú¨",
  Philippines: "„Éï„Ç£„É™„Éî„É≥",
  China: "‰∏≠ÂõΩ",
  SouthKorea: "ÈüìÂõΩ",
  NorthKorea: "ÂåóÊúùÈÆÆ",
  Thailand: "„Çø„Ç§",
  Vietnam: "„Éô„Éà„Éä„É†",
  India: "„Ç§„É≥„Éâ",
  Indonesia: "„Ç§„É≥„Éâ„Éç„Ç∑„Ç¢",
  Malaysia: "„Éû„É¨„Éº„Ç∑„Ç¢",
  // ÂèØÁªßÁª≠Ë°•ÂÖÖ
};

export default function JobSeekerPage() {
  const [showAssistant, setShowAssistant] = useState(false);
  const [inputValue, setInputValue] = useState('');
  const [messages, setMessages] = useState([
    { role: 'AI', content: 'ÊàëÊòØÂª∫Êè¥ÈöäAIÂä©ÊâãÔºåËØ∑ÈóÆÈúÄË¶Å‰ªÄ‰πàÂ∏ÆÂä©Ôºü' },
  ]);
  const [selectedCountry, setSelectedCountry] = useState(null);

  const toggleAssistant = () => {
    setShowAssistant(!showAssistant);
  };

  const handleInputChange = (e) => setInputValue(e.target.value);

  const handleSend = () => {
    if (!inputValue.trim()) return;
    const userMessage = { role: '‰Ω†', content: inputValue };
    const aiEcho = { role: 'AI', content: 'ÊàëÊî∂Âà∞‰Ω†ÁöÑËØù‰∫ÜÔºö' + inputValue };
    setMessages([...messages, userMessage, aiEcho]);
    setInputValue('');
  };

  const startVoiceInput = () => {
    const recognition = new window.webkitSpeechRecognition();
    recognition.lang = 'ja-JP';
    recognition.onresult = function (event) {
      const transcript = event.results[0][0].transcript;
      const userMessage = { role: '‰Ω†', content: transcript };
      const echoMessage = { role: 'AI', content: '‰Ω†ÂàöÂàöËØ¥‰∫ÜÔºö' + transcript };
      setMessages((prev) => [...prev, userMessage, echoMessage]);
    };
    recognition.start();
  };

  const workers = [
    { role: 'Êú®Â∑• ¬∑ Â§ßÈò™', desc: '5Âπ¥ÁªèÈ™åÔºåÂèØÁ´ãÂç≥‰∏äÂ≤ó', country: 'Japan' },
    { role: 'ÁîµÂ∑• ¬∑ ÂêçÂè§Â±ã', desc: 'Êé•ÂèóÈïøÊúüÈ°πÁõÆ', country: 'Japan' },
    { role: 'ÁÑäÂ∑• ¬∑ Ê®™Êª®', desc: 'ÈÖçÂêàÂ∫¶È´òÔºåÊúâÊâßÁÖß', country: 'Japan' },
    { role: 'ÁîµÁÑäÂ∑• ¬∑ È©¨Â∞ºÊãâ', desc: 'Ëã±ËØ≠ÁÜüÁªÉÔºåËè≤ÂæãÂÆæÊäÄÊúØÂ≠¶Ê†°ÊØï‰∏ö', country: 'Philippines' },
  ];

  const agencies = [
    { name: '‰∏ú‰∫¨ XX‰∏≠‰ªãÂÖ¨Âè∏', desc: '‰∏ìËê•Ë£ÖÊΩ¢„ÄÅÁîµÊ∞îÔºåËØÑ‰ª∑4.9‚≠êÔ∏è', country: 'Japan' },
    { name: 'Â§ßÈò™ YY‰∫∫ÂäõËµÑÊ∫ê', desc: 'ÂèØ‰ªãÁªçÂõ¢ÈòüÔºåÂìçÂ∫îËøÖÈÄü', country: 'Japan' },
    { name: 'È©¨Â∞ºÊãâ ABC‰∏≠‰ªã', desc: '‰∏∞ÂØåÊµ∑Â§ñÊ¥æÈÅ£ÁªèÈ™å', country: 'Philippines' },
  ];

  return (
    <div className="min-h-screen bg-gradient-to-b from-black via-gray-900 to-blue-950 text-white p-4">
      <header className="flex justify-between items-center py-4">
        <h1 className="text-2xl font-bold">Âª∫Êè¥Èöä ¬∑ Ê±Ç‰∫∫ËÄÖÂπ≥Âè∞</h1>
        <nav className="space-x-4">
          <button className="hover:underline">Â∑•‰∫∫‰ø°ÊÅØ</button>
          <button className="hover:underline">‰∏≠‰ªã‰ø°ÊÅØ</button>
          <button className="hover:underline">ÊàëÁöÑÂèëÂ∏É</button>
        </nav>
      </header>

      {/* ‰∫öÊ¥≤Âú∞ÂõæÂå∫Âüü */}
      <section className="mt-4 bg-white bg-opacity-5 rounded-xl p-2">
        <h2 className="text-lg font-semibold mb-2">üó∫Ô∏è ÈÄâÊã©ÂõΩÂÆ∂Êü•ÁúãÂØπÂ∫î‰ø°ÊÅØ</h2>
        <div className="w-full overflow-auto">
          <ComposableMap
            width={800}
            height={500}
            projection="geoMercator"
            projectionConfig={{ center: [135, 35], scale: 500 }}
          >
            <Geographies geography={geoUrl}>
              {({ geographies }) => (
                <>
                  {geographies.map((geo) => (
                    <Geography
                      key={geo.rsmKey}
                      geography={geo}
                      onClick={() => setSelectedCountry(geo.properties.name)}
                      style={{
                        default: { fill: "#999", outline: "none" },
                        hover: { fill: "#00bfff", outline: "none" },
                        pressed: { fill: "#00aaff", outline: "none" },
                      }}
                    />
                  ))}
                  {geographies.map((geo, i) => (
                    countryNameMap[geo.properties.name] ? (
                      <Annotation
                        key={"label-" + i}
                        subject={geoCentroid(geo)}
                        dx={0}
                        dy={0}
                        connectorProps={{ stroke: "none" }}
                      >
                        <text x={0} y={0} textAnchor="middle" fontSize={10} fill="#fff">
                          {countryNameMap[geo.properties.name]}
                        </text>
                      </Annotation>
                    ) : null
                  ))}
                </>
              )}
            </Geographies>
          </ComposableMap>
        </div>
        {selectedCountry && (
          <p className="mt-2 text-sm text-center text-blue-300">ÂΩìÂâçÈÄâÊã©Ôºö{selectedCountry}</p>
        )}
      </section>

      {/* ÂÖ∂‰ΩôÈÉ®ÂàÜ‰øùÊåÅ‰∏çÂèò... */}

    </div>
  );
}
